import React, { useEffect } from 'react'
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Stack from '@mui/material/Stack';
import { styled } from '@mui/material/styles';
import axiosClient from '../api/axiosClient';

const API_GET_RANKING = ""

function getRankingData()
{
  return axios.get(API_URL).then((responde) => responde.data)
}


const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: 'center',
  color: theme.palette.text.secondary,
}));

const RankingBox = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: 'center',
  color: theme.palette.text.secondary,
  fontSize: 25
}));

const Ranking = () => {
  const [ranks, setRanks] = useState([])

  useEffect(() => {
    let mounted = true
    getAPIData().then((items) => {
      if (mounted) {
        setRanks
      }
    })
  })
  return (
    <Box sx={{ width: '100%', padding: '10px', }}>
      <Stack spacing={2}>
        <RankingBox>Bảng xếp hạng</RankingBox>
        <Item>Username 1</Item>
        <Item>Username 2</Item>
        <Item>Username 3</Item>
        <Item>Username 4</Item>
        <Item>Username 5</Item>
        <Item>Username 6</Item>
        <Item>Username 7</Item>
        <Item>Username 8</Item>
        <Item>Username 9</Item>
        <Item>Username 10</Item>
      </Stack>
    </Box>
  )
}

export default Ranking
